import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function BasicExample({ category, content}) {
  return (
    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="img/clubmain.png" />
      <Card.Body>
        <Card.Title style={{ fontSize: "20px", Color: "#feae6c" }}>{category}</Card.Title>
        <Card.Text>
          {content}
        </Card.Text>
        <Button variant="primary" style={{ fontSize: "15px" }}>신청하기</Button>
      </Card.Body>
    </Card>
  );
}

export default BasicExample;
